func testRoleCommandToManyRemoveOpNextRoleCommandRoleMenus(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a RoleCommand
	var b, c, d, e RoleMenu

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, roleCommandDBTypes, false, strmangle.SetComplement(roleCommandPrimaryKeyColumns, roleCommandColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*RoleMenu{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, roleMenuDBTypes, false, strmangle.SetComplement(roleMenuPrimaryKeyColumns, roleMenuColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}

	err = a.AddNextRoleCommandRoleMenus(tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.NextRoleCommandRoleMenus(tx).Count()
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveNextRoleCommandRoleMenus(tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.NextRoleCommandRoleMenus(tx).Count()
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if b.NextRoleCommandID.Valid {
		t.Error("want b's foreign key value to be nil")
	}
	if c.NextRoleCommandID.Valid {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.NextRoleCommand != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.NextRoleCommand != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.NextRoleCommand != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.NextRoleCommand != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.NextRoleCommandRoleMenus) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.NextRoleCommandRoleMenus[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.NextRoleCommandRoleMenus[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

func testRoleCommandToOneRoleGroupUsingRoleGroup(t *testing.T) {
	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var local RoleCommand
	var foreign RoleGroup

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, roleCommandDBTypes, true, roleCommandColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize RoleCommand struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, roleGroupDBTypes, false, roleGroupColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize RoleGroup struct: %s", err)
	}

	local.RoleGroupID.Valid = true

	if err := foreign.Insert(tx); err != nil {
		t.Fatal(err)
	}

	local.RoleGroupID.Int64 = foreign.ID
	if err := local.Insert(tx); err != nil {
		t.Fatal(err)
	}

	check, err := local.RoleGroup(tx).One()
	if err != nil {
		t.Fatal(err)
	}

	if check.ID != foreign.ID {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	slice := RoleCommandSlice{&local}
	if err = local.L.LoadRoleGroup(tx, false, (*[]*RoleCommand)(&slice)); err != nil {
		t.Fatal(err)
	}
	if local.R.RoleGroup == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.RoleGroup = nil
	if err = local.L.LoadRoleGroup(tx, true, &local); err != nil {
		t.Fatal(err)
	}
	if local.R.RoleGroup == nil {
		t.Error("struct should have been eager loaded")
	}
}

func testRoleCommandToOneSetOpRoleGroupUsingRoleGroup(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a RoleCommand
	var b, c RoleGroup

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, roleCommandDBTypes, false, strmangle.SetComplement(roleCommandPrimaryKeyColumns, roleCommandColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, roleGroupDBTypes, false, strmangle.SetComplement(roleGroupPrimaryKeyColumns, roleGroupColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, roleGroupDBTypes, false, strmangle.SetComplement(roleGroupPrimaryKeyColumns, roleGroupColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(tx); err != nil {
		t.Fatal(err)
	}

	for i, x := range []*RoleGroup{&b, &c} {
		err = a.SetRoleGroup(tx, i != 0, x)
		if err != nil {
			t.Fatal(err)
		}

		if a.R.RoleGroup != x {
			t.Error("relationship struct not set to correct value")
		}

		if x.R.RoleCommands[0] != &a {
			t.Error("failed to append to foreign relationship struct")
		}
		if a.RoleGroupID.Int64 != x.ID {
			t.Error("foreign key was wrong value", a.RoleGroupID.Int64)
		}

		zero := reflect.Zero(reflect.TypeOf(a.RoleGroupID.Int64))
		reflect.Indirect(reflect.ValueOf(&a.RoleGroupID.Int64)).Set(zero)

		if err = a.Reload(tx); err != nil {
			t.Fatal("failed to reload", err)
		}

		if a.RoleGroupID.Int64 != x.ID {
			t.Error("foreign key was wrong value", a.RoleGroupID.Int64, x.ID)
		}
	}
}

